import image from "./assets/codingal_image-1.jpg";

import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';

// Keyframes for crazy animation
const floating = keyframes`
  0%, 100% {
    transform: translate3d(0, 0, 0);
  }
  50% {
    transform: translate3d(0, -20px, 10px) rotateY(15deg);
  }
`;

const rotate = keyframes`
  0% { transform: rotateY(0deg); }
  100% { transform: rotateY(360deg); }
`;

// Main container for styling
const Container = styled.div`
  padding: 0;
  margin: 0;
  font-family: 'Arial', sans-serif;
  background: linear-gradient(45deg, #ff5722, #0046ad, #00ff85);
  background-size: 400% 400%;
  animation: ${rotate} 10s infinite linear;
  color: white;
  min-height: 100vh;
`;

const Header = styled.header`
  background-color: #333;
  padding: 20px;
  color: #ffcc00;
  text-align: center;
  font-size: 40px;
  font-weight: bold;
  text-shadow: 2px 2px 10px rgba(0,0,0,0.8);
  transform: perspective(500px) rotateX(10deg);
`;

const Section = styled.div`
  padding: 40px;
  text-align: center;
  perspective: 1000px;
`;

const Title = styled.h2`
  font-size: 36px;
  margin-bottom: 20px;
  animation: ${floating} 5s ease-in-out infinite;
  color: #ffcc00;
  text-shadow: 0px 0px 15px #333;
  transform: perspective(500px) rotateY(15deg);
`;

const Description = styled.p`
  font-size: 20px;
  margin-bottom: 40px;
  color: #fff;
  transform: translate3d(0, 0, 50px) rotateY(5deg);
`;

const Button = styled.button`
  padding: 15px 30px;
  background: radial-gradient(circle, #ff00cc, #3333ff);
  color: white;
  border: none;
  border-radius: 30px;
  cursor: pointer;
  font-size: 20px;
  box-shadow: 0px 10px 20px rgba(0, 0, 0, 0.5);
  transform: perspective(500px) rotateY(30deg);
  transition: transform 0.5s ease, box-shadow 0.5s ease;

  &:hover {
    transform: translate3d(0, -10px, 30px) rotateY(10deg) scale(1.1);
    box-shadow: 0px 15px 40px rgba(0, 0, 0, 0.8);
  }
`;

const CourseList = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 30px;
  margin-top: 40px;
  perspective: 1000px;
`;

const CourseItem = styled.div`
  background-color: #333;
  border-radius: 15px;
  padding: 20px;
  box-shadow: 0px 10px 30px rgba(0, 0, 0, 0.7);
  transform: perspective(1000px) rotateY(15deg) rotateX(10deg);
  transition: transform 0.5s ease;

  &:hover {
    transform: perspective(1000px) rotateY(0deg) rotateX(0deg) scale(1.05);
  }
`;

const CourseTitle = styled.h3`
  font-size: 24px;
  margin-bottom: 10px;
  color: #ffcc00;
  text-shadow: 2px 2px 10px rgba(0,0,0,0.8);
`;

const CourseDescription = styled.p`
  font-size: 18px;
  color: white;
`;

const ImageContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const StyledImage = styled.img`
  width: 80%;
  border-radius: 20px;
  margin: 20px 0;
  transform: perspective(500px) rotateY(15deg) rotateX(10deg);
  transition: transform 0.5s ease, box-shadow 0.5s ease;

  &:hover {
    transform: perspective(500px) rotateY(5deg) rotateX(0deg) scale(1.1);
    box-shadow: 0px 15px 40px rgba(0, 0, 0, 0.8);
  }
`;

const Popup = styled.div`
  display: ${({ show }) => (show ? 'block' : 'none')};
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%) perspective(500px) rotateY(20deg);
  background-color: white;
  padding: 40px;
  border-radius: 10px;
  box-shadow: 0px 10px 40px rgba(0, 0, 0, 0.9);
  z-index: 10;
  width: 80%;
  max-width: 800px;
`;

const IframeContainer = styled.iframe`
  width: 100%;
  height: 400px;
  border-radius: 10px;
`;

function App() {
  const [showPopup, setShowPopup] = useState(false);

  return (
    <Container>
      <Header>Codingal</Header>

      {/* Section 1 - Introduction */}
      <Section>
        <Title>Online Coding & AI Classes for Kids and Teens</Title>
        <Description>Become the innovators of tomorrow with engaging live video lessons taught by world-class instructors.</Description>
        <Button onClick={() => setShowPopup(true)}>Talk to AI Assistant</Button>
      </Section>

      {/* Section 2 - Courses */}
      <Section>
        <Title>Our Bestselling Courses</Title>
        <CourseList>
          <CourseItem>
            <CourseTitle>Coding Grandmaster</CourseTitle>
            <CourseDescription>144 Lessons to master coding, build apps, games, and websites. Accredited by STEM.org</CourseDescription>
          </CourseItem>
          <CourseItem>
            <CourseTitle>Coding Prodigy</CourseTitle>
            <CourseDescription>96 Lessons designed for mastering coding skills, accredited by STEM.org</CourseDescription>
          </CourseItem>
          <CourseItem>
            <CourseTitle>Python Champion</CourseTitle>
            <CourseDescription>44 Lessons to master Python through interactive games, GUIs, and more.</CourseDescription>
          </CourseItem>
          <CourseItem>
            <CourseTitle>Game Development</CourseTitle>
            <CourseDescription>Learn to code games using Scratch and JavaScript in 36 lessons!</CourseDescription>
          </CourseItem>
        </CourseList>
      </Section>

      {/* Image Section */}
      <Section>
        <Title>Children Learning to Code</Title>
        <ImageContainer>
          <StyledImage src="https://via.placeholder.com/600" alt="Children learning to code" />
        </ImageContainer>
      </Section>

      {/* AI Assistant Popup */}
      <Popup show={showPopup}>
        <IframeContainer
          src="https://your-ai-assistant-url.com" // Replace with the URL for your AI iframe
          title="AI Assistant"
        ></IframeContainer>
        <Button onClick={() => setShowPopup(false)}>Close</Button>
      </Popup>
    </Container>
  );
}

export default App;
